import styled from 'styled-components';

const TechItemListContainer = styled.div`
  border: 5px solid blue;
  width: 75%;
  background: ivory;
  margin: 0 auto;
  color: black;
  display: flex;
  flex-wrap: wrap;
  justify-content: space-evenly;
  padding: 50px;




`;



export {
  TechItemListContainer



}
